// import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
// import Home from './Home';
import Layout from "./components/Layout";
import NavBar from "./components/Navbar";
import Sidebar from "./Sidebar";

function Home() {
  return (
    <div className="Home">
      <Layout>
        <h1 className="bg-clip-text text-6xl text-center hover:transition ease-in-out delay-150 bg-blue-500 hover:-translate-y-1 hover:scale-110 hover:bg-indigo-500 duration-300">Hello world!</h1>
      </Layout>
    </div>
    );
}

export default Home;
